    false,nt"url": null,nt"notes": "Proposal for 2009-2010 mortality surveillance
    for Highly Pathogenic Avian Influenza (HPAI) at Kulm Wetland Management District
    in North Dakota. Surveillance will focus on priority species known to be sensitive
    to HPAI. Surveillance will be conducted via ATV or foot-based observation surveys
    along wetlands on a weekly basis from roughly 1 April 2009 (ice-out) through 7 November
    2009 (freeze-up) during the migration and throughout the breeding season. Monitoring
    efforts will continue during the following spring migration, from roughly 1-31 March.
    Eleven sites included during the 2007 and 2008 HPAI monitoring will again be surveyed
    in 2009. In addition, 3-5 large wetlands (semi-permanent wetlands or permanent lakes)
    will be added for the 2009 field season due to the relative proximity to poultry
    production facilities in eastern Dickey County. Wetlands will be scanned with a
    spotting scope or binoculars. Moribund avian carcasses obtained during mortality
    surveillance efforts will be collected, properly packaged, and shipped to an accredited
    laboratory for HPAI detection and cause-of-death determination.  This proposal contains
    route maps for previously monitored sites as well as new wetlands.",nt"owner_org":
